                            <Cell style={{ background: '#007bff', color: 'white' }}>PRODUTO</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>DESCRIÇÃO</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>REF. FOR</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>PREÇO VENDA</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>VALOR</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>QUANTIDADE</Cell>
                        </Rows>
                        <Rows>
                            <Cell></Cell>
                            <Cell></Cell>
                            <Cell></Cell>
                            <Cell></Cell>
                        </Rows>
                    </StickyTable>
                </Row>
                         
            </Container>
        </div>
    );
}
